import React from 'react';
import './styles.css';

export default function Fetchdata(props) {
  const data = props.data;
  
  if (data !== "") {
    return (
      <div className="z">
        <h3>Fetched Data:</h3>
        <p>{data}</p>
      </div>
    );
  } else if(data) {
    return (
      <div className="z">
        <h3>Oops! Username not found</h3>
      </div>
    );
  }
}
